import React from "react";
import "./NavBar.css";

const NavBar = props => {
  return (
    <div className="NavBar">
      <img
        src="https://media.gettyimages.com/photos/low-angle-view-of-clouds-in-sky-picture-id683813195?s=612x612"
        alt="Pic of Me"
      />
    </div>
  );
};

export default NavBar;
